        ,tSource."ELE_CL_UID" 
        ,tSource."ELE_TagName" 
        ,tSource."ELE_Level" 
        ,tSource."ELE_Sort" 
        ,tSource."ELE_RecSort" 
        ,tSource."ELE_InnerHtml" 
    FROM OPENXML(@handle, '/table/row', 2) WITH 
    ( 
         "ELE_UID" uniqueidentifier 'ELE_UID[not(@*[local-name()="nil" and . ="true"])]' 
        ,"ELE_Parent_UID" uniqueidentifier 'ELE_Parent_UID[not(@*[local-name()="nil" and . ="true"])]' 
        ,"ELE_CL_UID" uniqueidentifier 'ELE_CL_UID[not(@*[local-name()="nil" and . ="true"])]' 
        ,"ELE_TagName" national character varying(256) 'ELE_TagName[not(@*[local-name()="nil" and . ="true"])]' 
        ,"ELE_Level" int 'ELE_Level[not(@*[local-name()="nil" and . ="true"])]' 
        ,"ELE_Sort" int 'ELE_Sort[not(@*[local-name()="nil" and . ="true"])]' 
        ,"ELE_RecSort" character varying(MAX) 'ELE_RecSort[not(@*[local-name()="nil" and . ="true"])]' 
        ,"ELE_InnerHtml" national character varying(MAX) 'ELE_InnerHtml[not(@*[local-name()="nil" and . ="true"])]' 
    ) AS tSource 
    
    -- REM: INNER JOIN ON FOREIGN KEYS should not be done here, because this removes entries with value "NULL" 

    WHERE (1=1) 
    AND 
    ( 
        tSource."ELE_CL_UID" IS NULL 
        OR EXISTS 
        ( 
            SELECT * FROM "dbo"."T_Checklist" AS tAlias000 
            WHERE (1=1) 
            AND tAlias000."CL_UID" = tSource."ELE_CL_UID" 
        ) 
    ) 

) -- End CTE 
-- SELECT * FROM CTE 



MERGE INTO dbo.T_ChecklistElements AS A 
USING CTE ON CTE.ELE_UID = A.ELE_UID 
WHEN MATCHED THEN 
    UPDATE 
        SET  A.ELE_Parent_UID = CTE.ELE_Parent_UID 
            ,A.ELE_CL_UID = CTE.ELE_CL_UID 
            ,A.ELE_TagName = CTE.ELE_TagName 
            ,A.ELE_Level = CTE.ELE_Level 
            ,A.ELE_Sort = CTE.ELE_Sort 
            ,A.ELE_RecSort = CTE.ELE_RecSort 
            ,A.ELE_InnerHtml = CTE.ELE_InnerHtml 

WHEN NOT MATCHED BY TARGET THEN 
    INSERT 
    ( 
         ELE_UID 
        ,ELE_Parent_UID 
        ,ELE_CL_UID 
        ,ELE_TagName 
        ,ELE_Level 
        ,ELE_Sort 
        ,ELE_RecSort 
        ,ELE_InnerHtml 
    ) 
    VALUES 
    ( 
         CTE.ELE_UID 
        ,CTE.ELE_Parent_UID 
        ,CTE.ELE_CL_UID 
        ,CTE.ELE_TagName 
        ,CTE.ELE_Level 
        ,CTE.ELE_Sort 
        ,CTE.ELE_RecSort 
        ,CTE.ELE_InnerHtml 
    ) 
 -- WHEN NOT MATCHED BY SOURCE THEN DELETE 
;
 
