DECLARE @handle int 
DECLARE @PrepareXmlStatus int 

EXEC @PrepareXmlStatus = sp_xml_preparedocument @handle OUTPUT, @XML 
-- EXEC @PrepareXmlStatus = sp_xml_preparedocument @handle OUTPUT, 'C:\Export1\med_Form.xml' 


;WITH CTE AS 
( 
    SELECT 
         tSource."PRO_UID" 
        ,tSource."PRO_Name" 
        ,tSource."PRO_Value" 
        ,tSource."PRO_ELE_UID" 
    FROM OPENXML(@handle, '/table/row', 2) WITH 
    ( 
         "PRO_UID" uniqueidentifier 'PRO_UID[not(@*[local-name()="nil" and . ="true"])]' 
        ,"PRO_Name" national character varying(4000) 'PRO_Name[not(@*[local-name()="nil" and . ="true"])]' 
        ,"PRO_Value" national character varying(MAX) 'PRO_Value[not(@*[local-name()="nil" and . ="true"])]' 
        ,"PRO_ELE_UID" uniqueidentifier 'PRO_ELE_UID[not(@*[local-name()="nil" and . ="true"])]' 
    ) AS tSource 
    
    -- REM: INNER JOIN ON FOREIGN KEYS should not be done here, because this removes entries with value "NULL" 

    WHERE (1=1) 
    AND 
    ( 
        tSource."PRO_ELE_UID" IS NULL 
        OR EXISTS 
        ( 
            SELECT * FROM "dbo"."T_ChecklistElements" AS tAlias000 
            WHERE (1=1) 
            AND tAlias000."ELE_UID" = tSource."PRO_ELE_UID" 
        ) 
    ) 

) -- End CTE 
-- SELECT * FROM CTE 



MERGE INTO dbo.T_Checklist_ZO_ElementProperties AS A 
USING CTE ON CTE.PRO_UID = A.PRO_UID 
WHEN MATCHED THEN 
    UPDATE 
        SET  A.PRO_Name = CTE.PRO_Name 
            ,A.PRO_Value = CTE.PRO_Value 
            ,A.PRO_ELE_UID = CTE.PRO_ELE_UID 

WHEN NOT MATCHED BY TARGET THEN 
    INSERT 
    ( 
         PRO_UID 
        ,PRO_Name 
        ,PRO_Value 
        ,PRO_ELE_UID 
    ) 
    VALUES 
    ( 
         CTE.PRO_UID 
        ,CTE.PRO_Name 
        ,CTE.PRO_Value 
        ,CTE.PRO_ELE_UID 
    ) 
 -- WHEN NOT MATCHED BY SOURCE THEN DELETE 
;
 
EXEC sp_xml_removedocument @handle 


GO 


PRINT 'Done Executing "03_Insert_T_Checklist_ZO_ElementProperties.sql"' 


